import React from 'react';
import Sketchfab from 'sketchfab';
import $ from 'jquery';

import {Link} from 'react-router-dom';

import '../../Style/Portfolio.css';

class Project12 extends React.Component {
    render(){

        let iframe = document.getElementById( 'api-frame' );
        let uid = '7w7pAfrCfjovwykkEeRFLGw5SXS';

        // By default, the latest version of the viewer API will be used.
        var client = new Sketchfab( iframe );

        // Alternatively, you can request a specific version.
        //let client = new Sketchfab( '6.4.1', iframe );

        client.init( uid, {
            success: function onSuccess( api ){
                api.start();
                api.addEventListener( 'viewerready', function() {

                    // API is ready to use
                    // Insert your code here
                    console.log( 'Viewer is ready' );

                } );
            },
            error: function onError() {
                console.log( 'Viewer error' );
            }
        } );

        return(
            <div className= "portfolio-panel" id = "portfolio">
                <div className= "container">
                    <div className= "orange-stripe"></div>
                    <h1 className= "portfolio-heading">Portfolio</h1>
                    <h5 className= "my-work">My Work</h5>
                </div>

                <div className= "container">
                    <iframe src="" id="api-frame" allowFullScreen mozallowfullscreen="true" webkitallowfullscreen="true"
                            width="400px" height="300px"></iframe>
                </div>
            </div>
        )
    }
}

export default Project12;
